INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 7, 1, 10118, 2, 5118061, "フリーマーケット会場", 20063115, "ペコリーヌとの出会い", "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2834, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 7, 1, 10118, 2, 5118062, "フリーマーケット会場", 20063115, "マホとの出会い", "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2835, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 7, 1, 10118, 2, 5118063, "ランドソル市街地", 20063115, "アキノとの出会い", "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2837, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 18, 1, 10118, 2, 5118064, "フリーマーケット会場", 20063115, "ジュンとの出会い", "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 4108402, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 18, 1, 10118, 2, 5118065, "フリーマーケット会場", 20063115, "カオリとの出会い", "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 4107402, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 91002, 40, 16, 1, 10118, 2, 5118066, "オーエド町", 20063115, "ニノンとの出会い", "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 9000227, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 19, 1, 10118, 3, 5118067, "フリーマーケット会場", 20063115, "スズナとの出会い", "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 2101181, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 18, 1, 10118, 3, 5118068, "ランドソル市街地", 20063115, "ナナカとの出会い", "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 4109402, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 18, 1, 10118, 3, 5118069, "フリーマーケット会場", 20063115, "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 4305402, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 18, 1, 10118, 3, 5118070, "ランドソル市街地", 20063115, "ユカリとの出会い", "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 4101402, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 91002, 40, 18, 1, 10118, 3, 5118071, "ランドソル市街地", 20063115, "アオイとの出会い", "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 4106402, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 91002, 40, 7, 1, 10118, 3, 5118072, "フリーマーケット会場", 20063115, "シノブとの出会い", "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 2836, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 0, 0, 0, 0, 10118, 1, 5118600, 0, 20063115, "オープニング", "彼女たちの新たな日常", 0, 0, 0);
